"    <div id=\"topicTitle\">",
"     Patient information: Pyloric stenosis (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pyloric-stenosis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H27265824\">",
"      <span class=\"h1\">",
"       What is pyloric stenosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pyloric stenosis is a condition that causes forceful vomiting in babies. It is caused by a problem with the &ldquo;pylorus,&rdquo; which is the opening between the stomach and the first part of the small intestine (",
"      <a class=\"graphic graphic_figure graphicRef72947 \" href=\"UTD.htm?5/27/5552\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Normally, food passes through the pylorus without a problem. But in pyloric stenosis, the muscle in the pylorus gets too thick and blocks the opening. Then, food can&rsquo;t pass from the stomach to the intestine. This causes symptoms.",
"     </p>",
"     <p>",
"      Pyloric stenosis happens most often in young babies, especially in babies 3 to 6 weeks old. It rarely happens in babies older than 3 months. Doctors don&rsquo;t know for sure what causes pyloric stenosis, but the condition sometimes runs in families.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27265839\">",
"      <span class=\"h1\">",
"       What are the symptoms of pyloric stenosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pyloric stenosis causes vomiting, usually right after a feeding. The vomiting, called &ldquo;projectile vomiting,&rdquo; is forceful. This type of vomiting is different from the less forceful vomiting that happens when a baby spits up. In pyloric stenosis, vomit shoots far out from the baby&rsquo;s mouth.",
"     </p>",
"     <p>",
"      It is common for babies with pyloric stenosis to seem hungry and want to feed again after they vomit.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27265854\">",
"      <span class=\"h1\">",
"       Should I call my baby&rsquo;s doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If your baby has these symptoms, tell his or her doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27265869\">",
"      <span class=\"h1\">",
"       Is there a test for pyloric stenosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor or nurse will ask about your baby&rsquo;s symptoms and do an exam. This will help the doctor or nurse decide whether your baby&rsquo;s vomiting is normal (spitting up) or abnormal.",
"     </p>",
"     <p>",
"      If the doctor or nurse thinks your baby could have pyloric stenosis, he or she will probably do an imaging test called an ultrasound. An ultrasound uses sound waves to create pictures of the inside of the body. It is the usual test to check for pyloric stenosis.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27265884\">",
"      <span class=\"h1\">",
"       How is pyloric stenosis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pyloric stenosis is usually treated with surgery. During surgery, the doctor will widen the pylorus so that food can pass through it from the stomach to the intestines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27265899\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
