"      Aphthasol&reg;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F133843\" xmlns=\"file://www.w3.org/1999/xhtml\">",
