"    <ul>",
"     <li>",
"      Anti-inflammatory, Locally Applied",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F133829\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
