"   <div class=\"block ars drugH1Div\" id=\"F133841\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     1% to 2%:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Dermatologic: Allergic contact dermatitis",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Gastrointestinal: Oral irritation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     &lt;1% (Limited to important or life-threatening): Contact mucositis",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F133816\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hypersensitivity to amlexanox or any component of the formulation",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F133805\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      <i>",
"       Concerns related to adverse effects:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Mucositis: Discontinue therapy if contact mucositis develops.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Rash: Discontinue therapy if rash develops.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      <i>",
"       Special populations:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Pediatrics: Safety and efficacy have not been established in children.",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F13298738\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     None known.",
"    </p>",
"   </div>",
"   <div class=\"block dri drugH1Div\" id=\"F6217887\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Drug Interactions",
"    </span>",
"    <br/>",
"    <br/>",
"    <div class=\"lexi\" id=\"lexiInteractAddInfo\">",
"     (For additional information:",
"     <a class=\"dip\" href=\"./drug-interaction\" target=\"_blank\">",
"      Launch Lexi-Interact&trade; Drug Interactions Program",
"     </a>",
"     )",
"    </div>",
"    <div class=\"lexi\" id=\"lexiInteractImgB\">",
"     <img border=\"0\" height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"    </div>",
"    <div class=\"clear\">",
"    </div>",
"    <p style=\"text-indent:0em;display:inline\">",
"     There are no known significant interactions.",
"    </p>",
"   </div>",
"   <div class=\"block prf drugH1Div\" id=\"F133809\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Risk Factor",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     B (",
"     <a class=\"graphic graphic_table\" href=\"UTD.htm?16/42/17068\">",
"      show table",
"     </a>",
"     )",
"    </p>",
"   </div>",
"   <div class=\"block pri drugH1Div\" id=\"F133819\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Implications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Due to lack of data, avoid use in pregnancy, if possible.",
"    </p>",
"   </div>",
"   <div class=\"block lac drugH1Div\" id=\"F133832\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Lactation",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Excretion in breast milk unknown/use caution",
"    </p>",
"   </div>",
"   <div class=\"block fee drugH1Div\" id=\"F133818\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pricing: U.S. (Medi-Span&reg;)",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Paste",
"     </b>",
"     (Aphthasol Mouth/Throat)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     5% (3 g): $26.99",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F5539814\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Aftaid (PT);",
"     </li>",
"     <li>",
"      An He (CL);",
"     </li>",
"     <li>",
"      Lexanox (IN);",
"     </li>",
"     <li>",
"      Miraftil (NL);",
"     </li>",
"     <li>",
"      Solfa (JP);",
"     </li>",
"     <li>",
"      Xishumai (CL)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F133804\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     As a benzopyrano-bipyridine carboxylic acid derivative, amlexanox has anti-inflammatory and antiallergic properties; it inhibits chemical mediatory release of the slow-reacting substance of anaphylaxis (SRS-A) and may have antagonistic effects on interleukin-3",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F133815\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Some from swallowed paste",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hydroxylated and conjugated metabolites",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 3.5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: 2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (17% as unchanged drug)",
"    </p>",
"   </div>",
"  </div>",
"  <div id=\"topicAgreement\">",
"   Use of UpToDate is subject to the",
"   <a class=\"licenseLink\" href=\"./license\" id=\"sla_in_page\" target=\"_blank\">",
"    Subscription and License Agreement",
"   </a>",
"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Greer RO Jr, Lindenmuth JE, Juarez T, et al, &ldquo;A Double-Blind Study of Topically Applied 5% Amlexanox in the Treatment of Aphthous Ulcers,&rdquo;",
"      <i>",
"       J Oral Maxillofac Surg",
"      </i>",
"      , 1993, 51(3):243-8.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?25/27/26035/abstract-text/8445464/pubmed\" id=\"8445464\" target=\"_blank\">",
"        8445464",
